import React from 'react';
import ReactDom from 'react-dom';

//our page 
function Body() {
    return (
        <div>
            <button class="ui primary button">
                Save
            </button>
            <button class="ui button">
                Discard
            </button>
        </div>
    )
}


class App extends React.Component {

    render(paoeshuoa) {
        return (
            <div>
                <p>{paoeshuoa}</p>
                <Body />
            </div>
        )
    };
};


ReactDom.render(<App />, document.getElementById('root'));
